import React, { useState } from "react";
import emailjs from "emailjs-com";
import { Player } from "@lottiefiles/react-lottie-player";
import logo from "./assets/logo.png";
import qr from "./assets/qr.png";
import successImg from "./assets/success.png";

function App() {
  const [formData, setFormData] = useState({
    name: "",
    occupation: "",
    email: "",
    whatsapp: "",
    problem: "",
    preferredTime: "",
    screenshot: null,
  });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: files ? files[0] : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    let base64Image = "";
    if (formData.screenshot) {
      const reader = new FileReader();
      reader.readAsDataURL(formData.screenshot);
      base64Image = await new Promise((resolve) => {
        reader.onload = () => resolve(reader.result);
      });
    }

    emailjs.send(
      "service_ted5m2h",
      "template_5qmfosa",
      {
        name: formData.name,
        email: formData.email,
      },
      "D8Cr-U9g1MVqsc5bv"
    );

    emailjs.send(
      "service_ted5m2h",
      "template_nzvxr9o",
      {
        name: formData.name,
        email: formData.email,
        occupation: formData.occupation,
        whatsapp: formData.whatsapp,
        problem: formData.problem,
        preferredTime: formData.preferredTime,
        screenshot: base64Image,
      },
      "D8Cr-U9g1MVqsc5bv"
    );

    setSubmitted(true);
  };

  return (
    <div className="min-h-screen text-white font-sans bg-[#0a0b25] relative overflow-hidden">
      {/* Star background animation */}
      <div className="absolute inset-0 z-0 overflow-hidden">
        <div className="stars"></div>
        <div className="twinkling"></div>
      </div>

      {/* Main Content */}
      <div className="relative z-10">
        {/* Header */}
        <header className="sticky top-0 z-50 bg-[#101225] bg-opacity-90 shadow px-6 py-4 flex justify-between items-center">
          <div className="flex items-center gap-3">
            <img src={logo} alt="Logo" className="w-10 h-10" />
            <div>
              <h1 className="text-xl font-bold text-blue-300">Ghar-ki-Baat</h1>
              <p className="text-sm text-gray-300">Where Your Mind Finds Peace</p>
            </div>
          </div>
          <nav className="hidden md:flex gap-6 text-blue-200 font-medium">
            <a href="#home" className="hover:text-white">Home</a>
            <a href="#book" className="hover:text-white">Book</a>
            <a href="#contact" className="hover:text-white">Contact</a>
          </nav>
        </header>

        {/* Hero Section */}
        <section className="py-20 px-6 md:px-20">
          <div className="max-w-6xl mx-auto flex flex-col md:flex-row items-center justify-between gap-10">
            <div className="md:w-1/2 mb-10 md:mb-0">
              <h2 className="text-4xl font-bold text-blue-300 mb-4">SafeCircle: A Place to Breathe</h2>
              <p className="text-lg text-gray-300">Talk about anything — life, stress, or silence. We listen with care, not judgment. Book a session and feel lighter.</p>
            </div>
            <div className="md:w-1/3 flex flex-col items-center">
              <div className="relative">
                <img src={logo} alt="Hero Logo" className="w-48 h-48 drop-shadow" />
                <div className="absolute -top-10 -right-6 w-32 h-32">
                    <Player
                    autoplay
                    loop
                    src="https://lottie.host/19f0db56-884e-40e7-a40a-4ad0385053c0/0EQ9zsz2XR.json"
                    />
                </div>
                </div>
              <Player
                autoplay
                loop
                src="https://lottie.host/fd4c69c8-4451-45c4-84ad-68f913d27688/yEKVt8KObZ.json"
                style={{ height: "180px", width: "180px" }}
              />
              <p className="text-sm text-blue-200 mt-2">He brings peace ✌️</p>
            </div>
          </div>
        </section>

        {/* What We Do */}
        <section id="home" className="p-10 max-w-4xl mx-auto text-center bg-[#181a38] rounded-xl shadow-lg mt-10">
          <h2 className="text-2xl font-bold text-blue-300 mb-6">What We Do</h2>
          <ul className="space-y-3 text-lg text-gray-200">
            <li>🌙 Safe space to talk — freely, fearlessly.</li>
            <li>🎧 Calm, one-on-one conversations — no pressure.</li>
            <li>🌌 Feel lighter, gain clarity, find inner calm.</li>
          </ul>
        </section>
      </div>
    </div>
  );
}

export default App;
